import React from 'react';
import PropTypes from 'prop-types';

export const Checkout = ({itemCount, itemPrice, checkout=false, onClickCheckout}) => (
      <div className="container mr-2">
        <div className="row justify-content-end {(checkout?:'border border-light':'')}">
         <span className="text-md-center">
          {itemCount > 0 ?
            <span className="text-md-center">{itemCount} Items @ ${itemPrice}</span>
            :
            <span/> 
          }
          {itemCount > 0 ?
          <button type="button" className="btn btn-primary ml-2" onClick={onClickCheckout} >{checkout?"Make Payment":"Checkout"}</button>
          :
          <button type="button" className="btn btn-muted ml-2" >{checkout?"Make Payment":"Checkout"}</button>
          }
          </span>
        </div>
      </div>
);

Checkout.propTypes = {
  itemCount: PropTypes.number.isRequired,
  itemPrice: PropTypes.number.isRequired,
  onClickCheckout: PropTypes.func.isRequired
}
